package com.yskj.models;import com.yskj.utils.DateUtils;import com.yskj.utils.UUIDGenerator;import lombok.Data;import java.util.ArrayList;import java.util.List;//表名称 insupload@Datapublic class InsUpload extends BaseEntity {	private static final long serialVersionUID = 1L;	public InsUpload() {		super();	}	    //上传文件名称    private String name;    //上传状态    private Boolean status;    //类型  0天 1周 2月 3年    private Integer type;    //批次    private String batch;    private List<InsUploadDay> insUploadDayList;    public void add(InsUploadDay insUploadDay){        if(insUploadDayList==null){            insUploadDayList = new ArrayList<>();        }        insUploadDayList.add(insUploadDay);    }}